function ProductMenu() {

    const productItems = ["Pizzas", "Pastas", "Poppers", "Breads", "Drinks", "Deserts"]

    const navItems = productItems.map(items => <p>{items}</p>)

    return (
        <div>
           {navItems} 
        </div>
    )
}

export default ProductMenu
